const DeleteQuote = async (props) => {
  const responce = await fetch(`http://localhost:8080/quotes/${props}`, {
    method: 'DELETE',
    headers: {
      'Content-Type': 'application/json',
    },
  });

  if (!responce.ok) {
    throw new Error('Could not detele quote.');
  }
  useEffect(() => {
    history.push('/quotes');
  }, [history]);
  return true;
};

export default DeleteQuote;
